import React from 'react';
import { BrowserRouter, useRoutes } from 'react-router-dom';
import Home from './pages/Home'
import Knowledges from './pages/Knowledges';
import Contact from './pages/contact';
import NotFound from './pages/NotFound';
import PorteFolio from './pages/PorteFolio';


const App = () => {
  return (
      <>
      <BrowserRouter>
        <Switch
            useRoutes path="/" component={Home}
            useRoute path="/competences" component={Knowledges}
            useRoute path="/portefolio" component={PorteFolio}
            useRoute path="/contact" component={Contact}
            useRoute component={NotFound}
            />

      </BrowserRouter>
      </>
  );
};

export default App;
